import React from 'react';
import Tilt from 'react-parallax-tilt';
import prs from './Logo.png';
import './Logo.css';

const Logo = () => {
  return (
	<div className= 'ma4 mt0'>
	  <Tilt>
      <div style={{ height: '150px', backgroundColor: 'darkgreen' }}>
        <h1><img src = {prs}/></h1>
      </div>
    </Tilt>
	</div>
  );
}

export default Logo;
